import React from 'react';
import { Route, Routes } from 'react-router-dom';
import { ContextProvider } from './Components/utils/global.context';//esto seria useDentistStates

import Navbar from './Components/Navbar';
import Footer from './Components/Footer';
import Home from './Routes/Home';
import Contact from './Routes/Contact';
import Detail from './Routes/Detail';
import Favs from './Routes/Favs';

function App() {

  const { themeState } = ContextProvider();

  return (
    <div className={themeState.theme ? 'App' : 'dark'}> ;//revisar esta linea
      <Navbar />
      <Routes>
        <Route path="/" exact component={Home} />
        <Route path="/contacto" component={Contact} />
        <Route path="/dentist/:id" component={Detail} />
        <Route path="/favs" component={Favs} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
